TRUNCATE TABLE pim_products RESTART IDENTITY;

-- Insert batch #1

-- RESET ESTABLISHMENTS PK AND SEQUENCE COUNT
SELECT MAX(id) pim_products_max_id FROM pim_products;
SELECT nextval('pim_products_id_seq') AS pim_products_nextval;
SELECT setval('pim_products_id_seq', (SELECT MAX(id) FROM pim_products)) AS pim_products_setval;
SELECT setval('pim_products_id_seq', COALESCE((SELECT MAX(id)+1 FROM pim_products), 1), false) AS pim_products_val;
